      <script type="text/javascript">//<![CDATA[


function initMap(p,c,b) {
  
var p = [{lat: 47.63626, lng: -122.33862}, {lat: 47.62845, lng: -122.33866}, {lat: 47.62841, lng: -122.33959}, {lat: 47.62812, lng: -122.33936}, {lat: 47.62744, lng: -122.33903}, {lat: 47.62736, lng: -122.3389}, {lat: 47.62703, lng: -122.33879}, {lat: 47.62711, lng: -122.33982}, {lat: 47.62717, lng: -122.34356}, {lat: 47.63563, lng: -122.34347}, {lat: 47.6361, lng: -122.34357}, {lat: 47.63658, lng: -122.34379}, {lat: 47.63738, lng: -122.34438}, {lat: 47.63801, lng: -122.34193}, {lat: 47.63789, lng: -122.34186}, {lat: 47.63812, lng: -122.34018}, {lat: 47.63812, lng: -122.33884}, {lat: 47.63763, lng: -122.3387}, {lat: 47.63626, lng: -122.33862}]
var b = {north:47.63812, south:47.62703, west:-122.34438, east:-122.33862,}
var c = {lat:47.632575, lng:-122.3415}
  
  var everythingElse = [ // covers the (mercator projection) world
    new google.maps.LatLng(85,180),
    new google.maps.LatLng(85,90),
    new google.maps.LatLng(85,0),
    new google.maps.LatLng(85,-90),
    new google.maps.LatLng(85,-180),
    new google.maps.LatLng(0,-180),
    new google.maps.LatLng(-85,-180),
    new google.maps.LatLng(-85,-90),
    new google.maps.LatLng(-85,0),
    new google.maps.LatLng(-85,90),
    new google.maps.LatLng(-85,180),
    new google.maps.LatLng(0,180),
    new google.maps.LatLng(85,180)];


  // Define the LatLng coordinates for the polygon's path.
var triangleCoords = p;

const map = new google.maps.Map(document.getElementById("map"), {
    mapId: "3782c2d2aeaec7e5", 
    center: c,
  });

map.fitBounds(b);
map.panToBounds(b);    

  neighMap = new google.maps.Polygon({
    paths: [everythingElse, triangleCoords],
    strokeOpacity: 0,
    strokeWeight: 0,
    fillColor: "#fff",
    fillOpacity: 1
  });

  neighMap.setMap(map);
}
